import React, { useState } from 'react';

const App = () => {
  const [one, two] = useState();

  const inputEvent = (e) => {
    console.log(e.target.value);
    two(e.target.value);
  };

  return (
    <>
      <div className="div">
        <h1>Hello, </h1>
      </div>
      <input
        type="text"
        placeholder="Enter your Name"
        onChange={inputEvent}
      ></input>
      <button>Click Me</button>
    </>
  );
};

export default App;
